customColumn1.onClick:
{{
  (() => {
    const row = Informacion_clientes.triggeredRow || Informacion_clientes.selectedRow;
    if (!row) { showAlert("Selecciona un cliente.", "warning"); return; }

    storeValue("cliente_edit_row", row, true);  // <- indica modo editar
    showModal("Modal_Editar");
  })()
}}

