  const clientesById = (clientes || []).reduce((acc, c) => {
    const id = String(c.id_cliente ?? "").trim();
    if (id) acc[id] = c;
    return acc;
  }, {});

  // Une la informaciÃ³n
  return fact.map(f => {
    const id = String(f.id_cliente ?? "").trim();
